function limitanome(nome){
		
	var aNome = nome.split(" ");
	var ntam  = aNome.length;
	var nome_formatado = aNome[0]+" "+aNome[ntam-1];
	if(ntam == 1){
		return aNome[0].toLowerCase().replace(/(?:^|\s)\S/g, function(a) { return a.toUpperCase(); });
	}else{
		return nome_formatado.toLowerCase().replace(/(?:^|\s)\S/g, function(a) { return a.toUpperCase(); });
	}
	
}
